Why not directly using a list, am I missing something?

class ElementManager:
    def __init__(self):
        self.elements = []

    def add_element(self, element):
        if element in self.elements:
            return
        self.elements.append(element)

    def remove_element(self, element):
        try:
            self.elements.remove(element)
        except ValueError:
            print(f"Element '{element}' not found.")

    def get_random_element(self):
        if not self.elements:
            return None
        return random.choice(self.elements)

import random

class data_set(list):

    def append(self, __object):
        if __object in self:
            return
        return super().append(__object)

    def remove(self, __object):
        if __object not in self:
            return
        return super().remove(__object)

    def getRandom(self):
        return random.choice(self)

Couldn't the inital problem of get_random being o(n) be resolved by using the keySet() method of the hashmap? This would return a list of the keys of which we could then choose a random one based on its index, and then we would return the value in the hashset at a key:
return self.map.get( random.choice(self.map.keySet()))
from what I know im pretty sure hashmaps usually store a key list regardless so this should all be o(1)... ?

