from random import randrange

class Myclass():
    def __init__(self):
        self.__my_set = set()
        self.__my_list = []  # Initialize my_list as an empty list
        self.__length = 0
        self.__altered = False

    def add(self, value: int) -> None:
        self.__my_set.add(value)
        self.__altered = True

    def remove(self, value: int) -> None:
        self.__my_set.discard(value)
        self.__altered = True

    @staticmethod
    def calc_len(my_set):
        return len(my_set)

    @staticmethod
    def create_list(my_set):
        return list(my_set)

    def get_random(self) -> int:
        if not self.__altered and self.__length == 0:  # Check if length is 0 to avoid 
            return None
        elif self.__altered:
            self.__length = self.calc_len(self.__my_set)
            self.__my_list = self.create_list(self.__my_set)
            return self.__my_list[randrange(self.__length)]
        else:
            return self.__my_list[randrange(self.__length)]

